import './App.css';



async function getData() {
    let decision = Math.floor(Math.random() *3+1)
    if(decision === 1){
        //Just NPC
        const npc = await fetch('https://api.open5e.comGET/monsters/?challenge_rating=&armor_class=&type=&name='+ +'&document=&document__slug='
        ).then(result => result.json());
        return npc
    }else if(decision === 2){
        //Just Monster
        const monster = await fetch('https://api.open5e.comGET/monsters/?challenge_rating=&armor_class=&type=&name='+ +'&document=&document__slug='
        ).then(result => result.json());
        return monster
    } else if (decision === 3){
        //Both
        const npc = await fetch('https://api.open5e.comGET/monsters/?challenge_rating=&armor_class=&type=&name='+ +'&document=&document__slug='
        ).then(result => result.json());
        const monster = await fetch('https://api.open5e.comGET/monsters/?challenge_rating=&armor_class=&type=&name='+ +'&document=&document__slug='
        ).then(result => result.json());
        return monster + " " + npc
    }


}







function RandomMonster() {

    return (
      <div className='App-header'>
        <button className='App' onClick={getData}>1-5</button>
        <button className='App'>6-10</button>
        <button className='App'>11-15</button>

      </div>
    );
}




export default RandomMonster;
